import React from 'react';
import { Link } from 'react-router-dom';
import './Pages.css';

const TrackOrders = () => {
  // Get orders from localStorage and filter for active ones
  const allOrders = JSON.parse(localStorage.getItem('weKnowOrders') || '[]');
  const activeOrders = allOrders
    .filter(order => (order.status || 'pending') === 'pending' || (order.status || 'pending') === 'in_transit')
    .slice(0, 3); // Show only the 3 most recent orders as "active"

  // If no pending orders, show the most recent order as "in transit" for demo
  if (activeOrders.length === 0 && allOrders.length > 0) {
    const mostRecent = allOrders[0];
    activeOrders.push({
      ...mostRecent,
      status: 'in_transit',
      estimatedDelivery: '30 minutes',
      driver: 'John D.',
      location: 'On the way to your location'
    });
  }

  const loading = false;
  const error = null;

  return (
    <div className="page-container">
      <div className="page-header">
        <Link to="/" className="back-button">
          ← Back to Home
        </Link>
        <h1>Track Orders</h1>
      </div>

      <div className="page-content">
        {loading ? (
          <div className="loading-state">
            <div className="loading-spinner"></div>
            <p>Loading your active orders...</p>
          </div>
        ) : error ? (
          <div className="error-state">
            <div className="error-icon">⚠️</div>
            <h3>Error Loading Orders</h3>
            <p>{error}</p>
            <button onClick={() => window.location.reload()} className="retry-button">
              Try Again
            </button>
          </div>
        ) : activeOrders.length > 0 ? (
          <div className="orders-list">
            {activeOrders.map((order) => (
              <div key={order.id} className="order-card">
                <div className="order-header">
                  <h3>{order.dish_name}</h3>
                  <span className={`status-badge ${(order.status || 'pending').toLowerCase().replace(' ', '-')}`}>
                    {order.status || 'Pending'}
                  </span>
                </div>

                <div className="order-details">
                  <p><strong>Order ID:</strong> {order.id || 'N/A'}</p>
                  <p><strong>Date:</strong> {order.timestamp ? new Date(order.timestamp).toLocaleDateString() : 'N/A'}</p>
                  <p><strong>Servings:</strong> {order.servings || 2}</p>
                  <p><strong>Status:</strong> {order.status || 'Pending'}</p>
                  {order.estimatedDelivery && (
                    <p><strong>Estimated Delivery:</strong> {order.estimatedDelivery}</p>
                  )}
                  {order.driver && (
                    <p><strong>Driver:</strong> {order.driver}</p>
                  )}
                  {order.location && (
                    <p><strong>Location:</strong> {order.location}</p>
                  )}
                </div>

                <div className="order-actions">
                  <button className="action-button">Track on Map</button>
                  <button className="action-button secondary">Contact Driver</button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="empty-state">
            <div className="empty-icon">🚚</div>
            <h3>No Active Orders</h3>
            <p>Your current deliveries will appear here</p>
            <Link to="/" className="cta-button">
              Order Something
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default TrackOrders;
